    true,nt"url": null,nt"notes": "Credit Management System. Outsourced Internet-based
    application.   CMS stores and processes data related to USAID credit programs. The
    system provides information related to loans under USAID guarantee coverage. It
    facilitates the flow of information between financial institutions and USAID to
    accelerate fees and claims processing, and to avoid data entry duplication. It does
    not interact with any other systems. No data is transmitted from the system besides
